import * as React from 'react';
import { Avatar, Button, Card, Title, Paragraph, Text } from 'react-native-paper';
import { View, StyleSheet, Image, ScrollView, SafeAreaView } from 'react-native';
import { AntDesign } from '@expo/vector-icons';


const DishCard = (props) => (
    /*   <Card style={styles.shadow} onPress={props.onPress}>
          <Card.Title title={props.name} subtitle={props.description} />
          <Card.Content>
              <Card.Cover source={{ uri: props.img }} style={{ borderRadius: 15, borderTopRightRadius: 15, borderTopLeftRadius: 15, height: '20%', width: '30%', }} />
              <AntDesign name="star" size={20} color="#ffcc00" >
                  <Text style={{ fontSize: 15, color: '#8c8c8c' }}> {props.rating}</Text>
                  <Text style={{ color: '#dedede' }}> |</Text>
                  <Text style={{ fontSize: 15, color: '#8c8c8c' }}> {props.dishType}</Text>
                  <Text style={{ color: '#dedede' }}> |</Text>
                  <Text style={{ fontSize: 15, color: '#8c8c8c' }}> {props.cookTime}</Text>
              </AntDesign>
          </Card.Content>
      </Card> */

    <Card
        title={"Vinny’s Barber"}
        subTitle={"852 N Virgil Ave, Beverly Hills"}
        image={{
            uri:
                "http://www.bretagne-paysage.fr/sites/bretagn2016/files/styles/large/public/diaporama/paysagiste-plerin_5.jpg?itok=9Qyy75zj"
        }}
        icon1={"share"}
        iconColor1={"#fff"}
        iconBackground1={"purple"}
        onClicked1={() => {
            alert("Hello!");
        }}
        icon2={"heart"}
        iconColor2={"#fff"}
        iconBackground2={"red"}
        onClicked2={() => {
            alert("Hello!");
        }}
    />
);

const styles = StyleSheet.create({

    shadow: {
        height: 130,
        width: 370,
        marginTop: 8,
        marginBottom: 8,
        elevation: 5,
        paddingTop: 15,
        alignItems: 'center',
        borderRadius: 15,
    },
})

export default DishCard;
